import React, { Component } from "react";
import ServiceList from "./ServiceList";
import homeimage from "../images/home-image.png";
import "bootstrap/dist/css/bootstrap.min.css";

export default class Home extends Component {
  render() {
    return (
      <div>
        {/* Hero Section */}
        <section className="hero-section d-flex align-items-center">
          <div className="container-fluid">
            <div className="row align-items-center min-vh-100">
              {/* Left side - Text */}
              <div className="col-12 col-md-4 text-center text-md-start ps-md-5">
                <h1 className="display-3 fw-bold">Hello</h1>
                <p className="lead">Welcome to Book My Clean</p>
              </div>

              {/* Right side - Image */}
              <div className="col-12 col-md-8 pe-md-5 text-center">
                <img
                  src={homeimage}
                  alt="Book My Clean"
                  className="img-fluid hero-image"
                />
              </div>
            </div>
          </div>
        </section>

        {/* Below content (hidden until scroll) */}
        <section className="below-section">
          <ServiceList />
          <div className="container border" style={{ height: "1000px" }}></div>
        </section>
      </div>
    );
  }
}
